import io
import base64
from PIL import Image

MAP = b''

INFINITY = b''

MIN_INFINITY = b''

SAVEAS = b''

SAVEASWHITE = b''

FOLDERBROWSEWHITE = b''

TISSUEWHITE = b''

TISSUEREMOVEWHITE = b''


def image_rescale(base64_str, x, y):
    buffer = io.BytesIO()
    imgdata = base64.b64decode(base64_str)
    img = Image.open(io.BytesIO(imgdata))
    new_img = img.resize((x, y))  # x, y
    new_img.save(buffer, format="PNG")
    img_b64 = base64.b64encode(buffer.getvalue())
    return img_b64
